import React from 'react'
import styled from 'styled-components'

import Text from './Text'

const Root = styled.div`
  display: flex;
`

const Web = styled.div`
  margin-right: 5rem;
  * {
    color: #aaa;
    margin-left: 2rem;
  }
`
const Sep = styled.span`
  color: ${props => props.theme.accent};
  /* transform: translateY(-3px); */
  margin: 0 1rem 0 .5rem;
  font-size: 1.5rem;
`

const Mony = styled.span`
  color: #9989;
  font-style: italic;
  font-weight: 200;
  transform: translateY(-2px);
  display: inline-block;
`

const Other = styled.div`

`

export default function Skills (props) {
  return (
    <Root>
      <div>
      <Text type='h2'>Web Development</Text>
      <Web>
        <Text type='h3'>HTML <Sep>|</Sep><Mony> Ben is pretty good at doing this. - Austin</Mony></Text>
        <Text type='h3'>CSS <Sep>|</Sep><Mony> Ben writes really cool styles. I like using his styles! - NaN</Mony></Text>
        <Text type='h3'>JS <Sep>|</Sep><Mony> What can I say, he's pretty good at it. - Tyler</Mony></Text>
        <Text type='h3'>React <Sep>|</Sep><Mony> When Ben passes props to components, its tight. - Emily</Mony></Text>
        <Text type='h3'>p5 <Sep>|</Sep><Mony> Have you seen his animations? They're </Mony></Text>
      </Web>
      </div>

      <div>
      <Text type='h2'>Fa'slhfshfsd</Text>
      <Other>
        <Text type='h3'>Java</Text>
        <Text type='h3'>Kotlin</Text>
      </Other>
      </div>
    </Root>
  )
}

